const MenuSection = (props) =>{
    return(
        <>
            <div className='menu-container'>
                <div className='sub-menu'>
                    <div onClick={props.newCustomerRegistration}>New Registration</div>
                    <div>Already Registred</div>
                </div>

                <div className='rate-list' style={{width:'20vw',paddingLeft:'6vw'}}>RateList</div>
            </div>
        </>
    )
}

export default MenuSection;
